import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <form action="#">
          <div className="flex">
            <label htmlFor="name">Customers</label>
            <input type="file" id = "file1"/>
          </div>
          <div className="flex">
            <label htmlFor="name">Products</label>
            <input type="file" id = "file2"/>
          </div>
          <div className="flex">
            <label htmlFor="name">Orders</label>
            <input type="file" id = "file3"/>
          </div>
        </form>
      </header>
    </div>
  );
}

export default App;
